import React from 'react';

const General = (props) => {
    const { tasks} = props;

    return (
      <ul>
        {tasks.map((task) => {
          return <li key={task.id}>{task.counter + "." + " "}{task.text}{"  " + task.X}</li>;
        })}
      </ul>
    );
  };

  export default Overview;
